import React from 'react';
import PropTypes from 'prop-types';

const MainLayout = ({ children }) => (
  <>
    <h1>Layout</h1>
    {children}
  </>
);

MainLayout.propTypes = {
  children: PropTypes.element.isRequired,
};

export default MainLayout;
